        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "根据越南法律，用户的姓名、电子邮件地址、密码和出生日期等信息可归类为“个人信息”。\n\n 特别是，\n (a) 根据第 72/2013 号法令，个人信息被定义为与个人身份识别和个人详细信息相关的信息，包括姓名、年龄、地址、身份证号码、电话号码、电子邮件地址和其他信息根据法律规定\n\n (b) 根据第 25/2010 号通告，个人信息是指足以准确识别个人的信息，其中至少包括以下详细信息之一：全名、出生日期、职业、头衔、联系地址、电子邮件地址、电话号码、身份卡号和护照号。个人隐私信息包括健康记录、纳税记录、社保卡号、信用卡号等个人秘密。\n\n 25号文适用于越南政府当局运营的网站收集和使用个人信息。 25号文不直接适用于非政府实体运营的网站收集和使用个人信息。但是，可以类推适用25号文的规定。此外，与适用于政府实体的标准相比，非政府实体可能会受到相同或更严格的标准的约束。"),
